INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 5, 0, "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？", 12300147, 2, 4.74, 9, 1, "vo_minigame_1012_result_1079", 7, 1, 1);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 5, 0, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 12300148, 2, 0.0, 9, 1, "vo_minigame_1012_result_1080", 1, 1, 1);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 5, 0, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 12300149, 2, 2.21, 9, 1, "vo_minigame_1012_result_1081", 8, 1, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 5, 0, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 12300150, 2, 2.46, 9, 1, "vo_minigame_1012_result_1082", 3, 1, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 5, 0, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 12300151, 2, 2.94, 9, 1, "vo_minigame_1012_result_1083", 3, 1, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 5, 0, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 12300152, 2, 4.19, 9, 1, "vo_minigame_1012_result_1084", 7, 1, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 5, 0, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 12300153, 2, 0.0, 9, 1, "vo_minigame_1012_result_1085", 1, 1, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 5, 0, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 12300154, 2, 2.63, 9, 1, "vo_minigame_1012_result_1086", 3, 1, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 0, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 12300155, 2, 5.53, 4, 1, "vo_minigame_1012_result_1087", 3, 1, 1);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 9, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 12300156, 2, 0.01, 4, 3, "vo_minigame_1012_result_1088", 3, 1, 1);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 3, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 12300157, 2, 4.15, 4, 1, "vo_minigame_1012_result_1089", 3, 1, 1);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 9, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 12300158, 2, 0.01, 4, 9, "vo_minigame_1012_result_1090", 9, 1, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 0, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 12300159, 2, 5.37, 4, 1, "vo_minigame_1012_result_1091", 3, 1, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 0, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 12300160, 2, 1.44, 4, 1, "vo_minigame_1012_result_1092", 3, 1, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 0, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 12300161, 2, 0.0, 4, 3, "vo_minigame_1012_result_1093", 3, 1, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 3, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 12300162, 2, 2.91, 4, 9, "vo_minigame_1012_result_1094", 3, 1, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 0, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 12300163, 2, 2.61, 4, 1, "vo_minigame_1012_result_1095", 5, 1, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 1, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 12300164, 2, 3.63, 0, 2, "vo_minigame_1012_result_1096", 4, 1, 1);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 1, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 12300165, 2, 4.16, 0, 2, "vo_minigame_1012_result_1097", 6, 1, 1);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 6, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 12300166, 2, 0.01, 0, 3, "vo_minigame_1012_result_1098", 3, 1, 1);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 0, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 12300167, 2, 5.75, 0, 2, "vo_minigame_1012_result_1099", 6, 1, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 1, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 12300168, 2, 5.64, 0, 2, "vo_minigame_1012_result_1100", 4, 1, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 8, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 12300169, 2, 5.73, 0, 4, "vo_minigame_1012_result_1101", 8, 1, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 1, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 12300170, 2, 5.32, 0, 3, "vo_minigame_1012_result_1102", 5, 1, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 9, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！", 12300171, 2, 2.37, 0, 9, "vo_minigame_1012_result_1103", 3, 1, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 3, "…かなり出来が悪いわね\n一旦休憩しましょうか？\nリフレッシュして頭切り替えて\nもう一度頑張りましょう！", 12300172, 2, 4.25, 0, 1, "vo_minigame_1012_result_1104", 9, 1, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (1001, 0, 0, "さ、勉強を始めるわよ", 13100101, 3, 0.0, 0, 7, "vo_minigame_1012_gamestart_100", 7, 1, 0);
