INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 0, "うちらまだまだ\nベンキョーちうだし…\nこれからだよねっ？\nね、ヒデサイ！", 22300157, 2, 5.28, 4, 3, "vo_minigame_1012_result_2089", 0, 2, 1);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 0, "ちょっとずつ覚えれば\nおーけーっしょ！\nうちと一緒に\nベンキョーだね！", 22300158, 2, 2.89, 4, 3, "vo_minigame_1012_result_2090", 0, 2, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 0, "うちベンキョー苦手でも\nヒデサイとベンキョー\nするのは好き！　だから\nもっかい教えてくれる？", 22300159, 2, 5.45, 4, 7, "vo_minigame_1012_result_2091", 0, 2, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 3, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 22300160, 2, 4.29, 4, 10, "vo_minigame_1012_result_2092", 4, 2, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 6, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", 22300161, 2, 4.64, 4, 8, "vo_minigame_1012_result_2093", 4, 2, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 0, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 22300162, 2, 3.14, 4, 5, "vo_minigame_1012_result_2094", 9, 2, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 1, 0, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", 22300163, 2, 6.59, 4, 4, "vo_minigame_1012_result_2095", 7, 2, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 0, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 22300164, 2, 0.0, 0, 3, "vo_minigame_1012_result_2096", 3, 2, 1);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 5, "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？", 22300165, 2, 2.2, 0, 10, "vo_minigame_1012_result_2097", 9, 2, 1);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 6, "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？", 22300166, 2, 0.01, 0, 4, "vo_minigame_1012_result_2098", 4, 2, 1);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 3, "え、ヒデサイも０点？\nじゃあうちと一緒じゃん♪\nまあ焦んないで\nベンキョーしてこーよ！", 22300167, 2, 2.8, 0, 2, "vo_minigame_1012_result_2099", 6, 2, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 6, "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変", 22300168, 2, 3.22, 0, 4, "vo_minigame_1012_result_2100", 9, 2, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 11, "０点だね…\nでも、へーきへーき\nリベンジしたら、結果オーライ！", 22300169, 2, 2.1, 0, 0, "vo_minigame_1012_result_2101", 4, 2, 2);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 3, "おやつ休憩して\nリベンジしよっ！\n甘いの食べたら、イケるっしょ！", 22300170, 2, 2.74, 0, 2, "vo_minigame_1012_result_2102", 0, 2, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 9, "ヒデサイでも\nおにムズな感じ？\nじゃあ、このテスト\n誰も解けなくない？", 22300171, 2, 3.0, 0, 9, "vo_minigame_1012_result_2103", 6, 2, 3);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3001, 0, 0, "…あれ？\n０が〇に見えてきた！\nきゃはっ、ちょっち\nやる気出てきたかも！", 22300172, 2, 4.37, 0, 2, "vo_minigame_1012_result_2104", 10, 2, 3);
